import './App.css';

function App() {
  return (
    <div class="bg-gray-100">
    <div class="h-screen flex items-center justify-center">
        <div class="bg-white border border-gray-300 p-8 rounded-lg max-w-md w-full">
            <h1 class="text-2xl font-semibold text-center mb-6">Weather App</h1>
            <form class="flex flex-col items-center">
                <input type="text" placeholder="Enter your location"
                    class="border border-gray-300 px-4 py-2 rounded-lg w-full mb-4 focus:outline-none" />
                <p class="text-gray-500  text-center text-lg">Or</p>
                <button type="submit" class="bg-blue-500 text-white py-2 px-4 rounded-lg w-full">Detect Your
                    Location</button>
            </form>
        </div>
    </div>
</div>
  );
}

export default App;
